import React, { useState } from "react";

const RegisterPage = ({ onRegister }) => {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    password: "",
    idProof: null,
    photo: null,
  });

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    if (files) {
      setFormData({ ...formData, [name]: files[0] });
    } else {
      setFormData({ ...formData, [name]: value });
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!formData.name || !formData.email || !formData.password) {
      alert("Please fill all fields");
      return;
    }
    if (!formData.idProof || !formData.photo) {
      alert("Please upload ID proof and photo");
      return;
    }

    // Pass form data to parent (App.jsx)
    onRegister(formData);
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>Register</h2>
      <form onSubmit={handleSubmit} style={styles.form}>
        <input
          type="text"
          name="name"
          placeholder="Full Name"
          value={formData.name}
          onChange={handleChange}
          style={styles.input}
        />
        <input
          type="email"
          name="email"
          placeholder="Email"
          value={formData.email}
          onChange={handleChange}
          style={styles.input}
        />
        <input
          type="password"
          name="password"
          placeholder="Password"
          value={formData.password}
          onChange={handleChange}
          style={styles.input}
        />
        <label style={styles.label}>Upload ID Proof (Aadhar, Voter, Passport):</label>
        <input
          type="file"
          name="idProof"
          accept=".jpg,.jpeg,.png,.pdf"
          onChange={handleChange}
          style={styles.inputFile}
        />
        <label style={styles.label}>Upload Passport Size Photo:</label>
        <input
          type="file"
          name="photo"
          accept="image/*"
          onChange={handleChange}
          style={styles.inputFile}
        />
        <button type="submit" style={styles.button}>Register</button>
      </form>
    </div>
  );
};

const styles = {
  container: { maxWidth: "400px", margin: "50px auto", padding: "20px", border: "1px solid #ddd", borderRadius: "10px", background: "#f9f9f9" },
  title: { textAlign: "center", marginBottom: "20px" },
  form: { display: "flex", flexDirection: "column" },
  input: { margin: "10px 0", padding: "10px", border: "1px solid #ccc", borderRadius: "5px" },
  label: { marginTop: "10px", fontWeight: "bold" },
  inputFile: { margin: "10px 0" },
  button: { marginTop: "20px", padding: "10px", background: "#007bff", color: "#fff", border: "none", borderRadius: "5px", cursor: "pointer" }
};

export default RegisterPage;
